/*Table structure for table `tblbarang` */

DROP TABLE IF EXISTS `tblbarang`;

CREATE TABLE `tblbarang` (
  `Kode_brg` varchar(20) NOT NULL default '',
  `Deskripsi` varchar(255) default NULL,
  `kategori` varchar(255) default '0',
  `Satuan` varchar(50) default NULL,
  `golongan` varchar(100) default NULL,
  `tipe` enum('sendiri','titipan') NOT NULL default 'sendiri',
  `Stok` double(10,2) NOT NULL default '0.00',
  `Harga_beli` double(19,2) default '0.00',
  `Harga_jual` double(19,2) default '0.00',
  `Harga_jual2` double(19,2) default '0.00',
  `harga_jual3` double(19,2) NOT NULL default '0.00',
  `diskon` smallint(6) default '0',
  `Stok_minimal` double(10,2) default '0.00',
  `id_supplier` varchar(50) default NULL,
  `tgl_expire` date default NULL,
  `lokasi` varchar(50) default NULL,
  `batch` varchar(50) default NULL,
  PRIMARY KEY  (`Kode_brg`),
  KEY `Deskripsi` (`Deskripsi`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

