/* Trigger structure for table `detilbeli` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `tdetilbeli` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `tdetilbeli` AFTER INSERT ON `detilbeli` FOR EACH ROW BEGIN
declare ttl double;declare vhpp double;
declare disk double;
declare vppn double;
set ttl=(select coalesce(sum(`Harga_beli` * `jumlah_brg`),0)from detilbeli where `No_pembelian`=new.no_pembelian);
set disk=(select coalesce(sum(diskon),0)from detilbeli where `No_Pembelian`=new.no_pembelian);
set vppn=(select coalesce(sum(ppn),0)from detilbeli where `No_Pembelian`=new.no_pembelian);

set @ttl=ttl;set @disk=disk;set @ppn=vppn;
update pembelian set `total`=@ttl,total_diskon=@disk,ttlppn=@ppn where `no_pembelian`=new.no_pembelian;
update stokgudang set jumlah=jumlah+new.jumlah_brg where kode_gudang=new.kode_gudang and kode_brg=new.kode_brg;

if new.batch!='' then
update tblbarang set batch=new.batch where kode_brg=new.kode_brg;
end if;

if new.tgl_exp is not null then
update tblbarang set tgl_expire=new.tgl_exp where kode_brg=new.kode_brg;
end if;

set vhpp=(select harga_beli from tblbarang where kode_brg=new.kode_brg);
END */$$


DELIMITER ;

/* Trigger structure for table `detilbeli` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `tdetilbeli2` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `tdetilbeli2` AFTER DELETE ON `detilbeli` FOR EACH ROW BEGIN
declare ttl double;declare cek double (19,2);
declare disk double;declare vppn double;
set ttl=(select coalesce(sum(`Harga_beli` * `jumlah_brg`),0)from detilbeli where `No_Pembelian`=old.No_Pembelian);
set disk=(select coalesce(sum(diskon),0)from detilbeli where `No_Pembelian`=old.No_Pembelian);
set vppn=(select coalesce(sum(ppn),0)from detilbeli where `No_Pembelian`=old.no_pembelian);
set @ttl=ttl;set @disk=disk; set @ppn=vppn;
set cek=(select coalesce(total,0) from pembelian where no_pembelian=old.No_Pembelian);
if cek!=0 then
update pembelian set `total`=@ttl,total_diskon=@disk,ttlppn=@ppn where `No_pembelian`=old.No_Pembelian;
end if;
update stokgudang set jumlah=jumlah-old.jumlah_brg where kode_gudang=old.kode_gudang and kode_brg=old.kode_brg;
END */$$


