/* Trigger structure for table `detiljual` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `tdetiljualai` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `tdetiljualai` AFTER INSERT ON `detiljual` FOR EACH ROW BEGIN
declare ttl double;declare vppn double;
declare disk double;
set vppn=(select coalesce(sum(ppn),0)from detiljual where `No_Penjualan`=new.no_penjualan);
set ttl=(select coalesce(sum(`Harga_jual` * `jumlah_brg`),0)from detiljual where `No_Penjualan`=new.no_penjualan);
set disk=(select coalesce(sum(diskon),0)from detiljual where `No_Penjualan`=new.no_penjualan);
set disk=disk-(disk-new.diskon);
set @ttl=ttl;set @disk=disk;set @ppn=vppn;
update penjualan set ppn=@ppn,`jumlah`=@ttl,total_diskon=total_diskon+@disk where `no_penjualan`=new.no_penjualan;
update stokgudang set jumlah=jumlah-new.jumlah_brg where kode_brg=new.kode_brg and kode_gudang=new.kode_gudang;
END */$$


