DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `tdtlrtrbelibi` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `tdtlrtrbelibi` BEFORE INSERT ON `detilreturbeli` FOR EACH ROW BEGIN

declare vharga double(19,2);declare vdisc double(19,2);declare vttl double(19,2);
declare vkodegdg varchar(50);declare vid varchar(20);declare vidp varchar(20);
set vid=(select no_pembelian from retur_beli where no_retur=new.no_retur);
set @vid=vid;
set vkodegdg=(select kode_gudang from detilbeli where no_pembelian=@vid and kode_brg=new.kode_brg);
set @vkodegdg=vkodegdg;
set vharga=(Select harga_beli from detilbeli where no_pembelian=@vid and kode_brg=new.kode_brg);
set vdisc=(select (diskon/jumlah_brg) from detilbeli where no_pembelian=@vid and kode_brg=new.kode_brg);
set @vharga=vharga;set @vdisc=vdisc;
set new.harga_beli=@vharga;set new.diskon=@vdisc*new.jumlah;
set new.total=new.harga_beli*new.jumlah-new.diskon;
