declare disk double(6,5);declare cek double(19,2);
declare vhari int;declare vdpst double(19,2);declare vbyr double(19,2);
set vhari=old.hari;
set @vhari=vhari;
set new.Total=new.jumlah-new.total_diskon+new.ppn;
delete from jurnal where no_transaksi=new.no_penjualan and no_akun!='5.9';
if new.cash is not null and new.cash > 0  then
delete from keuangan where no_transaksi=new.no_penjualan and keterangan='Transaksi penjualan';
if new.cash<=new.total then
insert into keuangan(Tanggal,Keterangan,Pemasukan,no_transaksi) values(new.Tanggal,'Transaksi penjualan',new.cash,new.no_penjualan);
insert into jurnal values(null,new.Tanggal,'1.1','Kas',new.cash,0,new.no_penjualan,'');

else
insert into keuangan(Tanggal,Keterangan,Pemasukan,no_transaksi) values(new.Tanggal,'Transaksi penjualan',new.total,new.no_penjualan);
insert into jurnal values(null,new.Tanggal,'1.1','Kas',new.total,0,new.no_penjualan,'');


end if;
end if;


/*cek deposit pelanggan*/
set vdpst=(select jumlah_piutang from pelanggan where id_pelanggan=new.id_pelanggan);
set vbyr=0;
if vdpst<0 then
set vdpst=-1*vdpst;
 	  if vdpst>new.total then
 	  set vbyr=new.total;
 	  else
 	  set vbyr=vdpst;
 	  end if;
 	  
end if;
set @vbyr=vbyr;

set cek=(select coalesce(jumlah_piutang,0) from piutang where no_penjualan=new.no_penjualan);
if new.cash<new.total then 
if cek!=0 then
delete from piutang where no_penjualan=new.no_penjualan;
end if;
replace into piutang values(new.Tanggal,new.no_penjualan,new.total-new.cash,0,DATE_ADD(new.Tanggal,INTERVAL @vhari DAY),new.id_pelanggan);
insert into jurnal values(null,new.Tanggal,'1.3','Piutang',new.total-new.cash,0,new.no_penjualan,'');
else
delete from piutang where no_penjualan=new.no_penjualan;
replace into piutang values(new.Tanggal,new.no_penjualan,0,0,DATE_ADD(new.Tanggal,INTERVAL 0 DAY),new.id_pelanggan);
end if;
insert into jurnal values(null,new.Tanggal,'8.1','   Penjualan',0,new.total,new.no_penjualan,'');
insert into jurnal values(null,new.Tanggal,'8.2','HPP',new.harga_pokok_jual,0,new.no_penjualan,'');
insert into jurnal values(null,new.Tanggal,'1.5','   Persediaan barang dagang',0,new.harga_pokok_jual,new.no_penjualan,'');
if new.jenis='resep'and new.komisi>0 then 
insert into jurnal values(null,new.Tanggal,'1.1','Kas',new.komisi,0,new.no_penjualan,'');
insert into jurnal values(null,new.Tanggal,'5.9','   Komisi dokter',0,new.komisi,new.no_penjualan,'');
end if;
END */$$


