 _utf8'Menambah') union all select `s`.`Tanggal` AS `tanggal`,`s`.`id` AS `no_dokumen`,_utf8'penyesuaiankeluar' AS `keluar`,NULL AS `masuk`,`s`.`kode_brg` AS `kode_brg`,`s`.`jumlah` AS `jumlah_brg`,_utf8'penyesuaiankeluar' AS `penyesuaiankeluar` from `sesuai` `s` where (`s`.`Jenis` = _utf8'Mengurang') */;

